import React from "react";
import { Grid } from "../elements";
import styled from "styled-components";

const Header = (props) => {
  return (
    <React.Fragment>
      <Grid is_flex>
        <img src="https://d1unjqcospf8gs.cloudfront.net/assets/home/base/header/logo-basic-24b18257ac4ef693c02233bf21e9cb7ecbf43ebd8d5b40c24d99e14094a44c81.svg"></img>
        <Inputdiv>
          <Grid is_flex>
            <input
              placeholder="동네 이름, 물품명 등을 검색해보세요!"
              style={{
                border: "hidden",
                margin: "0px",
                padding: "10px",
                width: "340px",
                fontSize: "15px",
                color: "#CED4DA",
              }}
            ></input>
            <img src="https://d1unjqcospf8gs.cloudfront.net/assets/home/base/header/search-icon-7008edd4f9aaa32188f55e65258f1c1905d7a9d1a3ca2a07ae809b5535380f14.svg"></img>
          </Grid>
        </Inputdiv>
        <button>버튼1</button>
        <button>버튼2</button>
      </Grid>
    </React.Fragment>
  );
};

Header.defaultProps = {};

export default Header;

const Inputdiv = styled.div`
  border-radius: 5px;
  border: solid 1px #e9ecef;
  text-decoration: none;
  padding: 0 1.6rem;
  height: 40px;
  box-sizing: border-box;
  margin: 10px 20px;
`;
